/*
    Replay event format

    There are two types of events:

    1 byte event:
        * (MSB) 3 bits column index (0-7)
        * 3 bits row index (0-7)
        * 2 bits delta time to last event (0-2) [20ms]
    
    2 byte event (3 bytes needed):
        * 1 byte marker (0xff), marks 2 byte event following
        * (MSB) 3 bits column index (0-7)
        * 3 bits row index (0-7)
        * 10 bits delta time to last event (0-2) [20ms]
    
    At start, all lamps are considered off. Each lamp event toggles the
    state of one lamp in the matrix.

    Delta time of 0 indicates that event is happening at same point in
    time as the previous one.
*/

#include "Arduino.h"

// Two-byte event marker
#define AG_REPLAY_2B_MARKER 0xff

// Replay record, 1 byte
typedef struct AG_LAMP_SWITCH_1B_s
{
    uint16_t col : 3;    // lamp column
    uint16_t row : 3;    // lamp row
    uint16_t dttag : 2; // delta time tag [16ms] to the last event
} AG_LAMP_SWITCH_1B_t;

// Replay record, 2 bytes
typedef struct AG_LAMP_SWITCH_2B_s
{
    uint16_t col : 3;    // lamp column
    uint16_t row : 3;    // lamp row
    uint16_t dttag : 10; // delta time tag [16ms] to the last event
} AG_LAMP_SWITCH_2B_t;

